let string_of_figloc (fig : Ex.loc_fig) =
  let sp = Printf.sprintf in
  let string_of_fig = function
    | Ex.Point -> "Point"
    | Ex.Circle r -> sp "Circle %d" r
    | Ex.Rectangle (x, y) -> sp "Rectangle (%d, %d)" x y
    | Ex.Square x -> sp "Square %d" x in
  sp "{ x = %d; y = %d; fig = %s }" fig.x fig.y (string_of_fig fig.fig)

